            if substructure[i] < 0 || substructure[i] > len
                substructure[i] = 0
            end
        end
    end

    data = zeros(Float64, size(dataset.data,1), len, 4)
    for i=1:size(data,1)
        for j=1:len
            for k=1:4
                data[i,j,k] = dataset.data[i, j+startpos-1,k]
            end
        end
    end

    drawsubstructure(startpos, dataset, alignmentfile, joinpath(outputdir, string(startpos,"-",endpos,".rank", rank,"of",length(finalls),".svg")), data, dataset.gapfrequency[startpos:endpos], substructure, shapereactivities[startpos:endpos], lambdas[startpos:endpos], zeros(Float64,length(paired))[startpos:endpos], mapping)
    rank += 1
end




